import React, { Component } from "react";

class SearchBar extends Component {
  render() {
    return (
      <form className="form-inline">
        <div >

          <input type="text"  placeholder="firstname" />
        </div>
        <button type="submit" class="btn btn-default">
          Submit
        </button>
      </form>
    );
  }
}

export default SearchBar;
